                                <h2 class="mt-6 text-xl font-semibold text-gray-900">EcoSwap</h2>

                                <p class="mt-4 text-gray-500 text-sm leading-relaxed">
                                An innovative platform dedicated to facilitating the exchange of pre-owned items, fostering environmental consciousness, and nurturing community connections. By encouraging the reuse of products, our platform not only contributes to a greener Earth by reducing waste but also serves as a hub for building meaningful relationships within local communities. Join us in the mission to promote sustainability, reduce environmental impact, and strengthen the bonds that make our communities thrive.
